(29, 'MyCar', 'Lorem, ipsum dolor sit amet consectetur adipisicing elit. Quisquam, doloremque voluptatum quia aut necessitatibus consectetur molestiae rerum, quod neque odit delectus laboriosam voluptate voluptatem sint cum exercitationem? Inventore, illo nam.<br>', 'car.webp', 'car.jpg', '2023-12-08', 'O:8:\"stdClass\":3:{s:5:\"title\";s:8:\"Car Blog\";s:11:\"description\";s:349:\"Renting a car in the Philippines is a great way to explore the country at your own pace and visit the places you want to see. Coche Philippines is a rental marketplace platform that makes it easy to rent a car in the Philippines by offering a wide selection of vehicles to choose from, competitive rates, and flexible pick-up and drop-off locations.\";s:8:\"keywords\";a:10:{i:0;s:3:\"car\";i:1;s:6:\"sports\";i:2;s:3:\"car\";i:3;s:6:\"sports\";i:4;s:3:\"car\";i:5;s:6:\"sports\";i:6;s:3:\"car\";i:7;s:6:\"sports\";i:8;s:3:\"car\";i:9;s:6:\"sports\";}}', '3', 'mycar', 1, '1', 1);
INSERT INTO `tblblog` (`fldBlogID`, `fldBlogTitle`, `fldBlogDescription`, `fldBlogImage`, `fldBlogThumbnail`, `fldBlogDate`, `fldBlogMeta`, `fldBlogCategoryID`, `fldBlogSlug`, `fldBlogStatus`, `fldBlogAuthor`, `fldBlogViews`) VALUES
(30, 'Eyes', '<div>Laguna is a popular destination for those who dream of building their own home. With its mild climate, stunning landscapes, and close proximity to Manila, it\'s easy to see why so many people choose to call Laguna home.&nbsp;<span style=\"font-size: 0.875rem; font-weight: var(--bs-body-font-weight); letter-spacing: 0.0312rem; text-align: var(--bs-body-text-align);\">In this blog, we will explore the process of building your own home in Laguna and provide tips and insights to help you make your dream a reality.</span></div><div><span style=\"font-size: 0.875rem; font-weight: var(--bs-body-font-weight); letter-spacing: 0.0312rem; text-align: var(--bs-body-text-align);\"><br></span></div><div><img src=\"data:image/jpeg;base64,\" style=\"width: 25%;\" data-filename=\"___komi_san_minimalist_wallpaper_by_dianmouse_by_dianmouse_df3psxr-pre.jpg\"><span style=\"font-size: 0.875rem; font-weight: var(--bs-body-font-weight); letter-spacing: 0.0312rem; text-align: var(--bs-body-text-align);\"><br></span></div>', 'v2osk-in4xvkhyaii-unsplash.webp', 'car.jpg', '2023-12-10', 'O:8:\"stdClass\":3:{s:5:\"title\";s:15:\"Blog About Eyes\";s:11:\"description\";s:4:\"test\";s:8:\"keywords\";a:13:{i:0;s:6:\"school\";i:1;s:8:\"activity\";i:2;s:6:\"school\";i:3;s:8:\"activity\";i:4;s:6:\"school\";i:5;s:8:\"activity\";i:6;s:6:\"school\";i:7;s:8:\"activity\";i:8;s:6:\"school\";i:9;s:8:\"activity\";i:10;s:6:\"school\";i:11;s:8:\"activity\";i:12;s:8:\"donation\";}}', '1', 'eyes', 1, '1', 5);
